import React from "react";
import InputFields from "../../Components/InputField";
import SideImage from "./Components/SideImageArea/SideImage";
const Login = () => {
  return (
    <div style={{ display: "flex", minHeight: "100vh" }}>
      <div
        style={{
          width: "30%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <div>
          <SideImage />
        </div>
      </div>
      <div
        style={{
          width: "50%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          backgroundColor: "#C3C9D2",
          flexDirection: "column",
          marginTop:"-20px"
        }}
      >
        <div
          style={{
            fontFamily: "Open Sans",
            fontWeight: 400,
            fontSize: "32px",
            lineHeight: "44.8px",
          }}
        >
          Welcome to{" "}
          <span style={{ fontSize: "48px", fontFamily: "Roboto" }}>OrPak</span>
        </div>
        <div style={{ margin: "12px" }}>
          <InputFields placeholder={"User Name"} type={"text"} />
        </div>
        <div>
          <InputFields placeholder={"Password"} type={"password"} />
        </div>
      </div>
    </div>
  );
};

export default Login;
